function smallestCommons(arr) {
  var newArr = [];
  var primes = [];
  var leastCommon = [];

  arr = arr.sort();

  for(i=arr[0]; i < arr[1] + 1; i++) {
    newArr.push(i);  
  }

  primes = newArr.map(function(num) {

    if(num <= 3) {
      return num;  
    }
    else {

     var sqrt = Math.floor(Math.sqrt(num));

     for (i = 2; i <= sqrt; i++) {
       if (num % i === 0) {
         return i;
       }
     }

    return num;

   }

  });


  leastCommon = primes.reduce(function(prv, nxt) {
    return prv * nxt;
  });

}
